import Layout from '../../components/MyLayout';
import fetch from 'isomorphic-unfetch';

const Post = props => (
  <Layout>
    <h1>{props.park.location_info.name}</h1>
    <ul>
      <li>{props.park.location_info.region}</li>
      <li>{props.park.location_info.address}</li>     
      <li>{props.park.location_info.web}</li> 
    </ul>
  </Layout>
);

Post.getInitialProps = async function(context) {
  const { id } = context.query;
  const res = await fetch(`http://localhost:8080/parkpay/${id}`);
  const park = await res.json();

  return { park };
};

export default Post;
